import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Map from './components/Map';
import RightPanel from './components/rightpanel';
import MobilePanel from './components/MobilePanel';
import Contact from './pages/Contact';
import Links from './pages/Links';

function App() {
  const [showMap, setShowMap] = useState(true);
  const [showList, setShowList] = useState(true);
  const [sortType, setSortType] = useState("newest");
  const [selectedMag, setSelectedMag] = useState(2.0);
  const [dateFilter, setDateFilter] = useState("week");

  return (
    <Router>
      <div className="min-h-screen bg-[#303030]">
        <Navbar />
        <Routes>
          <Route path="/" element={
            <div className="relative">
              <div className="flex flex-col sm:flex-row">
                <div className="w-full sm:w-[calc(100%-300px)]">
                  <Map showMap={showMap} dateFilter={dateFilter} />
                </div>
                <div className="w-full sm:w-[300px]">
                  <RightPanel
                    quak={[]}
                    setSortType={setSortType}
                    selectedMag={selectedMag}
                    setSelectedMag={setSelectedMag}
                    dateFilter={dateFilter}
                    setDateFilter={setDateFilter}
                  />
                </div>
              </div>
              <MobilePanel
                showMap={showMap}
                setShowMap={setShowMap}
                setShowList={setShowList}
                sortType={sortType}
                setSortType={setSortType}
                dateFilter={dateFilter}
                setDateFilter={setDateFilter}
              />
            </div>
          } />
          <Route path="/contact" element={<Contact />} />
          <Route path="/links" element={<Links />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
